import {TOGGLE_TIMER, SET_SECONDS} from './types'


export const setIsActive = () => dispatch => {
    dispatch({
        type: TOGGLE_TIMER
    })
}

export const setSeconds = (num) => dispatch => {
    dispatch({
        type: SET_SECONDS,
        action: num
    })
}
